import { Account } from './';

const App = () => {
    const [token, setToken] = useState('');
    console.log(`Token is: ${token}`);
    return (
        <>
            <h1>Stranger's Things</h1>
            <Register setToken={setToken} />
        </>
    );
};

export default App;
